pragma solidity ^0.8.0;

import "./interfaces/IUniswapV2Pair.sol";
import "hardhat/console.sol";

library SafeMath {
  function add(uint x, uint y) internal pure returns (uint z) {
      require((z = x + y) >= x, 'ds-math-add-overflow');
  }

  function sub(uint x, uint y) internal pure returns (uint z) {
      require((z = x - y) <= x, 'ds-math-sub-underflow');
  }

  function mul(uint x, uint y) internal pure returns (uint z) {
      require(y == 0 || (z = x * y) / y == x, 'ds-math-mul-overflow');
  }
}

contract ArBot {
  using SafeMath for uint256;

  struct Reserves {
    uint256 dai1;
    uint256 weth1;
    uint256 dai2;
    uint256 weth2;
  }

  // Returns true if address of tokenA is smaller than address of tokenB
  function addressCompare(address tokenA, address tokenB) public pure returns (bool) {
    return tokenA < tokenB;
  }

  // Gets UniV2 reserves for DAI-WETH pools
  function getReserves(address pool1, address pool2) public view returns (Reserves memory reserves) {
    (uint256 dai1, uint256 weth1,) = IUniswapV2Pair(pool1).getReserves();
    (uint256 dai2, uint256 weth2,) = IUniswapV2Pair(pool2).getReserves();

    reserves = Reserves(dai1, weth1, dai2, weth2);
    console.log("Reserves1:", dai1, weth1);
    console.log("Reserves2:", dai2, weth2);
  }

  /**
    Following functions from Uni V2 Library at: 
      https://github.com/Uniswap/v2-periphery/blob/master/contracts/libraries/UniswapV2Library.sol
  */
  function getAmountOut(uint amountIn, uint reserveIn, uint reserveOut) internal pure returns (uint amountOut) {
    require(amountIn > 0, 'ArBot: INSUFFICIENT_INPUT_AMOUNT');
    require(reserveIn > 0 && reserveOut > 0, 'ArBot: INSUFFICIENT_LIQUIDITY');
    uint amountInWithFee = amountIn.mul(997);
    uint numerator = amountInWithFee.mul(reserveOut);
    uint denominator = reserveIn.mul(1000).add(amountInWithFee);
    amountOut = numerator / denominator;
  }

  function getAmountIn(uint amountOut, uint reserveIn, uint reserveOut) internal pure returns (uint amountIn) {
    require(amountOut > 0, 'ArBot: INSUFFICIENT_OUTPUT_AMOUNT');
    require(reserveIn > 0 && reserveOut > 0, 'ArBot: INSUFFICIENT_LIQUIDITY');
    uint numerator = reserveIn.mul(amountOut).mul(1000);
    uint denominator = reserveOut.sub(amountOut).mul(997);
    amountIn = (numerator / denominator).add(1);
  }
